import axios from 'axios';

const instance = axios.create({
    timeout: 10000,
    headers: {
        'Access-Control-Allow-Origin': 'http:/localhost:3000/prod'
    },
    withCredentials: true,
    responseType: 'json',
    maxRedirects: 10
});

export default instance;
